import React from "react";
import "./style.css";

function Navbar(props) {
    return (
        <nav className="navbar navbar-dark bg-dark transparent navbar-fixed-top" id="nav1">
            <div className="navDiv">
                <div className="navbar-brand" href="/">React Portfolio</div>
                <div className="navMenu" id="navAbout"> About</div>
                <div className="navMenu" id="navPort">Portfolio</div>
                <div className="navMenu" id="navContact">Contact</div>
            </div>
        </nav>
    );
}

export default Navbar;
